sources.sass\\layout\\_advantages.scss:
.advantages {
  padding-top: 37px;
  padding-bottom: 97px;
  background-color: var(--bg-color-light);
  @media screen and (min-width: 1280px) {
    background-color: var(--text-color-dark-bg);
  }
  .container {
    padding: 0 20px;
    @media screen and (min-width: 768px) {
      padding-left: 36px;
    }
  }
}

.advantages-list {
  @media screen and (min-width: 768px) {
    display: flex;
  }
  @media screen and (min-width: 1280px) {
    display: flex;
  }
}

.advantages-list-item {
  min-width: 230px;
  @media screen and (min-width: 768px) {
    min-width: 180px;
  }
  @media screen and (min-width: 1280px) {
    min-width: 330px;
  }
}

.advantages-list-item:not(:last-child) {
  margin-bottom: 38px;
  @media screen and (min-width: 768px) {
    margin-bottom: 0;
    margin-right: 60px;
  }
  @media screen and (min-width: 1280px) {
    margin-bottom: 0;
    margin-right: 30px;
  }
}

.advantages-list-item::before {
  content: '';
  display: block;
  height: 50px;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: left;
}

.advantages-list-item.icon-udder::before {
  background-image: url(../images/udder.svg);
}
.advantages-list-item.icon-apples::before {
  background-image: url(../images/apples.svg);
}
.advantages-list-item.icon-heart::before {
  background-image: url(../images/heart.svg);
}

.advantages-item-title {
  margin-top: 16px;
  margin-bottom: 14px;
  font-family: var(--title-font);
  font-weight: 400;
  font-size: 36px;
  line-height: 1, 139;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: var(--main-dark-color);
  text-align: left;
  @media screen and (min-width: 768px) {
    margin-top: 36px;
    font-size: 48px;
    line-height: 1, 146;
  }
  @media screen and (min-width: 1280px) {
    margin-top: 40x;
    font-size: 58px;
    line-height: 1, 138;
  }
}

.advantages-item-text {
  font-weight: 700;
  font-size: 12px;
  line-height: 170%;
  @media screen and (min-width: 768px) {
    font-size: 14px;
    line-height: 174%;
  }
  @media screen and (min-width: 1280px) {
    font-size: 16px;
    line-height: 176%;
    letter-spacing: 0.02em;
  }
}

