/*MOBILE VERSION*/

.contacts-section {
  background-color: var(--bg-color-light);
  padding-bottom: 113px;
}

.contacts-list {
  &-sections {
    background-color: var(--text-color-dark-bg);

    margin-right: auto;
    margin-left: auto;

    border-radius: 24px;
    padding-top: 43px;
    padding-right: 21px;
    padding-bottom: 43px;
    padding-left: 20px;
    width: 220px;

    box-shadow: 0px 8px 30px rgba(212, 20, 67, 0.1);
  }

  &-sections + &-sections {
    margin-top: 20px;
  }

  &-type {
    display: flex;
    justify-content: center;
    align-items: center;

    background-color: var(--bg-ice-coffee-cafe);
    color: var(--text-color-dark-bg);

    font-size: 12px;
    font-weight: 500;
    line-height: 22px;
    letter-spacing: 0.04em;
    width: 80px;
    height: 16px;
    border-radius: 4px;

    margin-bottom: 25px;

    &-foodtruck {
      display: flex;
      justify-content: center;
      align-items: center;

      background-color: var(--bg-milkshakes-foodtruck);
      color: var(--text-color-dark-bg);

      font-size: 12px;
      font-weight: 500;
      line-height: 22px;
      letter-spacing: 0.04em;
      width: 130px;
      border-radius: 4px;

      margin-bottom: 25px;
    }
  }

  &-locations {
    display: flex;

    color: var(--text-color-dark);

    font-size: 12px;
    font-weight: 500;
    line-height: 22px;
    letter-spacing: 0.04em;

    margin-bottom: 10px;
  }

  &-descriptions {
    color: var(--text-color-light);

    font-size: 12px;
    font-weight: 500;
    line-height: 18px;
    letter-spacing: 0em;

    padding-bottom: 25px;
    margin-bottom: 25px;
    border-bottom: 1px solid var(--border-color);
  }

  &-schedule {
    font-size: 12px;
    font-weight: 500;
    line-height: 22px;
    letter-spacing: 0em;
  }

  &-time {
    font-size: 12px;
    font-weight: 500;
    line-height: 22px;
    letter-spacing: 0em;

    color: var(--label-color);
  }

  &-tel,
  &-mail {
    color: var(--text-color-light);

    font-size: 12px;
    font-weight: 500;
    line-height: 18px;
    letter-spacing: 0em;
  }

  &-btn {
    border: 0;
    border-radius: 22px;
    cursor: pointer;
  }

  &-buttons {
    margin-bottom: 10px;
  }
}

.margin {
  margin-bottom: 10px;
}

.border {
  padding-bottom: 25px;
  margin-bottom: 25px;
  border-bottom: 1px solid var(--border-color);
}

.our-locations-btn {
  position: relative;
  background-color: #d41342;
  color: var(--text-color-dark-bg);

  transition: var(--timing-function) var(--transition-duration);

  padding: 0;
  padding-left: 20px;
  padding-right: 29px;

  height: 44px;
  width: 161px;

  font-size: 16px;
  font-weight: 700;
  line-height: 21px;
  letter-spacing: 0em;
}

.franchise-btn {
  position: relative;
  background-color: var(--text-color-dark-bg);
  color: var(--main-dark-color);

  transition: var(--timing-function) var(--transition-duration);

  padding: 0;
  padding-left: 32px;
  padding-right: 49px;

  height: 44px;
  width: 161px;
  font-size: 16px;
  font-weight: 700;
  line-height: 21px;
  letter-spacing: 0em;

  &:hover,
  &:focus {
    background-color: var(--hover-light-bg-btn);
  }
}

.contacts-button-wrapper {
  display: flex;
  justify-content: center;
  padding-top: 54px;
}

.send-button-white {
  fill: var(--text-color-dark-bg);
  position: absolute;
  top: 19px;
  margin-left: 8px;
}

.send-button-red {
  fill: var(--main-dark-color);
  position: absolute;
  top: 19px;
  margin-left: 14px;
}

